import React from 'react';
import Header from '../../components/Header';
import {
  Container,
  Main,
  Title,
  Description,
  TextInformationContainer,
  FormContainer,
} from './styles';

const RequestService: React.FC = () => {
  return (
    <Container>
      <Header minimalist />
      <Main>
        <TextInformationContainer>
          <Title>Needing a Day Laborer?</Title>
          <Description>
            We have thousands of professionals available for your needs, after a
            few moments they will contact you so you can choose the best one.
          </Description>
          <Description>
            To help our professional filtering please write a brief description
            about the service.
          </Description>
        </TextInformationContainer>

        <FormContainer />
      </Main>
    </Container>
  );
};

export default RequestService;
